import '../Dashboard/Dashboard.css';
import {Header} from '../Header/Header.jsx';

export const Dashboard = () => {
    return(
    <body>
    <div class="dashboard-wrapper">
    <Header/>
    
    <div class="hello">
        <h1> Ini dashboard</h1>
        <h1>Halo dunia</h1>
    </div>
    </div>
    </body>
   
);


}

export default Dashboard;
